import React, { Component } from "react";
import TodoList from "./TodoList";

class App extends Component {

	constructor(props) {
    	super(props);

    	this.state = {
      	lists: []
    	};
  	}

	render() {
		return (
			<div>
        		<TodoList/>
        		<button> New List </button>
    		</div>
    		);
	}
}

export default App;
